import React, {Component, Fragment} from 'react';
import {BrowserRouter as Router} from 'react-router-dom';
import ToDoList from './ToDoList';
import NavBar from './NavBar';

class App  extends Component {

  render(){
    return(
      <Router>
        <Fragment>
          <ToDoList />
          <NavBar />
        </Fragment>
      </Router>
    )
  }

}//end App class

export default App;
